import UrlRoute from "../helpers/UrlRouter.js";
import { api } from "./api";

const getSingleAdminProfile = async () => {
  const response = await api.get(UrlRoute.getSingleAdmin);
  return response.data;
};

const settingService = {
  getSingleAdminProfile,
};

export default settingService;
